INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60000, 190804, 0, 1);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 60000, 0, 0, 2);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60000, 0, 0, 3);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 1, 60000, 0, 0, 4);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60000, 0, 0, 5);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60000, 0, 0, 6);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60000, 0, 0, 7);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 3, 60000, 0, 0, 8);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 3, 60000, 0, 0, 9);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60000, 0, 0, 10);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60000, 0, 0, 11);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 3, 60000, 0, 0, 12);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 4, 60000, 0, 0, 13);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 4, 60000, 0, 0, 14);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 4, 60000, 0, 0, 15);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60000, 0, 0, 16);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60000, 0, 0, 17);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 0, "カリン", 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 60000, 190804, 0, 18);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 7, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 60000, 190804, 0, 19);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "ハツネ", 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 80001, 101201, 0, 20);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "ハツネ", 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 80001, 101201, 0, 21);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "シオリ", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0, 80001, 103801, 0, 22);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "シオリ", 1, "来年も、\n一緒にいられたら…\nうれしいな", 0, 80001, 103801, 0, 23);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 2, "キョウカ", 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 80001, 103601, 0, 24);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 2, "キョウカ", 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 80001, 103601, 0, 25);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 2, "ミミ", 1, "おにいちゃんとあってから、\n1年たったよ～！", 0, 80001, 102001, 0, 26);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 2, "ミミ", 1, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0, 80001, 102001, 0, 27);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 2, "ミソギ", 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0, 80001, 100401, 0, 28);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 2, "ミソギ", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0, 80001, 100401, 0, 29);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 3, "マホ", 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 80001, 101001, 0, 30);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 3, "マホ", 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 80001, 101001, 0, 31);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 3, "イリヤ", 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, 80001, 104401, 0, 32);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 3, "イリヤ", 1, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, 80001, 104401, 0, 33);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 3, "カオリ", 2, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, 80001, 101701, 0, 34);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 3, "カオリ", 2, "これからも、どうぞよろしく\nお願いするさ～！", 0, 80001, 101701, 0, 35);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 4, "サレン", 0, "あんたと出会ってからもうそんなに\nたつのね～", 0, 80001, 102801, 0, 36);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 4, "サレン", 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 80001, 102801, 0, 37);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 4, "スズメ", 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0, 80001, 102501, 0, 38);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 4, "スズメ", 1, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, 80001, 102501, 0, 39);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 5, "タマキ", 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 80001, 104601, 0, 40);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 5, "タマキ", 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 80001, 104601, 0, 41);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 5, "ミフユ", 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, 80001, 104801, 0, 42);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 5, "ミフユ", 1, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, 80001, 104801, 0, 43);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 6, "アキノ", 0, "あなたさまと出会ってもう1年…", 0, 80001, 103201, 0, 44);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 6, "アキノ", 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 80001, 103201, 0, 45);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 6, "ユカリ", 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, 80001, 103401, 0, 46);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 6, "ユカリ", 1, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, 80001, 103401, 0, 47);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 7, "クリスティーナ", 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 80001, 107101, 0, 48);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 7, "クリスティーナ", 0, "ともかくこれからも\n愉しませてくれよ☆", 0, 80001, 107101, 0, 49);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 7, "ジュン", 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, 80001, 104701, 0, 50);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 7, "ジュン", 1, "見えないから分からないって？\nそれもそうだな…", 0, 80001, 104701, 0, 51);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 8, "トモ", 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 80001, 103701, 0, 52);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 8, "トモ", 0, "これからもよろしくね！", 0, 80001, 103701, 0, 53);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 8, "マツリ", 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, 80001, 100501, 0, 54);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 8, "マツリ", 1, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, 80001, 100501, 0, 55);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 9, "ミヤコ", 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 80001, 100701, 0, 56);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 9, "ミヤコ", 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 80001, 100701, 0, 57);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 9, "シノブ", 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, 80001, 103101, 0, 58);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 9, "シノブ", 1, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, 80001, 103101, 0, 59);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 10, "アンナ", 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 80001, 100901, 0, 60);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 10, "アンナ", 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 80001, 100901, 0, 61);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 10, "ナナカ", 1, "君と出会ってもう1年だって！\n早いねー！", 0, 80001, 101301, 0, 62);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 10, "ナナカ", 1, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, 80001, 101301, 0, 63);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 11, "ミツキ", 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 80001, 105101, 0, 64);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 11, "ミツキ", 0, "これからも、いろんなところを\n調べさせてね？", 0, 80001, 105101, 0, 65);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 11, "ルカ", 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 0, 80001, 105601, 0, 66);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 11, "ルカ", 1, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, 80001, 105601, 0, 67);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 11, "エリコ", 2, "早いものですわね、あなた様と\nお会いして、もう1年…", 0, 80001, 102701, 0, 68);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 11, "エリコ", 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0, 80001, 102701, 0, 69);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 12, "アヤネ", 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 80001, 102301, 0, 70);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 12, "アヤネ", 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 80001, 102301, 0, 71);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 12, "チカ", 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, 80001, 104201, 0, 72);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 12, "チカ", 1, "私のことを見守ってください\nできることなら、ずっと…", 0, 80001, 104201, 0, 73);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 12, "クルミ", 2, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, 80001, 102101, 0, 74);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 12, "クルミ", 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, 80001, 102101, 0, 75);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 13, "シズル", 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 80001, 104901, 0, 76);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 13, "シズル", 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 80001, 104901, 0, 77);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 13, "リノ", 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, 80001, 101101, 0, 78);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 13, "リノ", 1, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, 80001, 101101, 0, 79);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 14, "ユイ", 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 80001, 100201, 0, 80);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 14, "ユイ", 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 80001, 100201, 0, 81);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 14, "ヒヨリ", 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, 80001, 100101, 0, 82);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 14, "ヒヨリ", 1, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, 80001, 100101, 0, 83);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 14, "レイ", 2, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, 80001, 100301, 0, 84);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 14, "レイ", 2, "キミに背中を預けられる日が、\n早くきますように", 0, 80001, 100301, 0, 85);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 15, "ペコリーヌ", 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 80001, 105801, 0, 86);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 15, "ペコリーヌ", 0, "これからもずっと、覚えていて\nくださいね！", 0, 80001, 105801, 0, 87);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 15, "コッコロ", 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, 80001, 105901, 0, 88);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 15, "コッコロ", 1, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, 80001, 105901, 0, 89);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 15, "キャル", 2, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, 80001, 106001, 0, 90);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 15, "キャル", 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, 80001, 106001, 0, 91);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 1, 0, "スズメ", 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 60001, 112101, 0, 92);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, 60001, 0, 0, 93);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60001, 0, 0, 94);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 60001, 0, 0, 95);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 60001, 0, 0, 96);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 1, 60001, 0, 0, 97);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 60001, 0, 0, 98);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 60001, 0, 0, 99);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60001, 0, 0, 100);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60001, 0, 0, 101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 60001, 0, 0, 102);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 3, 60001, 0, 0, 103);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 3, 60001, 0, 0, 104);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60001, 0, 0, 105);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60001, 0, 0, 106);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 3, 60001, 0, 0, 107);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 3, 60001, 0, 0, 108);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 3, 60001, 0, 0, 109);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 4, 60001, 0, 0, 110);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 4, 60001, 0, 0, 111);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 4, 60001, 0, 0, 112);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60001, 0, 0, 113);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, 60001, 0, 0, 114);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 4, 60001, 0, 0, 115);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60001, 0, 0, 116);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 0, "スズメ", 3, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 60001, 112101, 0, 117);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 7, "スズメ", 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, 60001, 112101, 0, 118);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "ペコリーヌ", 0, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 80003, 105801, 0, 119);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "コッコロ", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, 80003, 105901, 0, 120);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "コッコロ", 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, 80003, 105901, 0, 121);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "キャル", 2, "え？　ちょっと\nいきなりなにっ？", 0, 80003, 106001, 0, 122);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "キャル", 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, 80003, 106001, 0, 123);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "ペコリーヌ", 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 80003, 105801, 0, 124);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "ペコリーヌ", 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 80003, 105801, 0, 125);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "コッコロ", 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 0, 80003, 105901, 0, 126);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "キャル", 2, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, 80003, 106001, 0, 127);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 1, "コッコロ", 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, 80003, 105901, 0, 128);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 1, "ペコリーヌ", 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 80003, 105801, 0, 129);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 1, "キャル", 2, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, 80003, 106001, 0, 130);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 1, "コッコロ", 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, 80003, 105901, 0, 131);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "キャル", 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 80003, 106001, 0, 132);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 2, "カリン", 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, 80003, 190801, 0, 133);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 2, "キャル", 0, "げっ…カリンじゃない\nなんでもないわよ！", 0, 80003, 106001, 0, 134);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 2, "カリン", 1, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, 80003, 190801, 0, 135);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 2, "キャル", 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 80003, 106001, 0, 136);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 2, "カリン", 1, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, 80003, 190801, 0, 137);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 2, "キャル", 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 80003, 106001, 0, 138);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 2, "キャル", 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 80003, 106001, 0, 139);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 2, "カリン", 1, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, 80003, 190801, 0, 140);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 2, "キャル", 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 80003, 106001, 0, 141);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "カリン", 1, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, 80003, 190801, 0, 142);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 2, "キャル", 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 80003, 106001, 0, 143);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 3, "コッコロ", 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 80003, 105901, 0, 144);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 3, "ペコリーヌ", 1, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, 80003, 105801, 0, 145);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 3, "コッコロ", 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 80003, 105901, 0, 146);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "コッコロ", 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 80003, 105901, 0, 147);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 3, "ペコリーヌ", 1, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, 80003, 105801, 0, 148);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 3, "ペコリーヌ", 1, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, 80003, 105801, 0, 149);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "コッコロ", 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 80003, 105901, 0, 150);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "ペコリーヌ", 1, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, 80003, 105801, 0, 151);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 3, "コッコロ", 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 80003, 105901, 0, 152);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "ペコリーヌ", 1, "えへへ、ありがとうございます\nコッコロちゃん！", 0, 80003, 105801, 0, 153);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 3, "コッコロ", 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 80003, 105901, 0, 154);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 3, "ペコリーヌ", 1, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, 80003, 105801, 0, 155);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 4, "ペコリーヌ", 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 80003, 105801, 0, 156);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "キャル", 1, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, 80003, 106001, 0, 157);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "ペコリーヌ", 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 80003, 105801, 0, 158);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 4, "キャル", 1, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, 80003, 106001, 0, 159);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 4, "ペコリーヌ", 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 80003, 105801, 0, 160);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 4, "キャル", 1, "…積極的？\nなんの話よ？", 0, 80003, 106001, 0, 161);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 4, "ペコリーヌ", 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 80003, 105801, 0, 162);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 4, "ペコリーヌ", 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 80003, 105801, 0, 163);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 4, "キャル", 1, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, 80003, 106001, 0, 164);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 4, "ペコリーヌ", 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 80003, 105801, 0, 165);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 4, "キャル", 1, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, 80003, 106001, 0, 166);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 4, "キャル", 1, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, 80003, 106001, 0, 167);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 5, "キャル", 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 80003, 106001, 0, 168);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 5, "コッコロ", 1, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, 80003, 105901, 0, 169);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 5, "キャル", 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 80003, 106001, 0, 170);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 5, "コッコロ", 1, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, 80003, 105901, 0, 171);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 5, "キャル", 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 80003, 106001, 0, 172);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 5, "コッコロ", 1, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, 80003, 105901, 0, 173);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 5, "キャル", 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 80003, 106001, 0, 174);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 5, "コッコロ", 1, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, 80003, 105901, 0, 175);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 5, "キャル", 0, "かくし芸？", 0, 80003, 106001, 0, 176);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 5, "コッコロ", 1, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, 80003, 105901, 0, 177);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 5, "キャル", 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 80003, 106001, 0, 178);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 6, "ペコリーヌ", 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 80003, 105801, 0, 179);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 6, "キャル", 2, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, 80003, 106001, 0, 180);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 6, "コッコロ", 1, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, 80003, 105901, 0, 181);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 6, "ペコリーヌ", 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 80003, 105801, 0, 182);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 6, "キャル", 2, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, 80003, 106001, 0, 183);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 6, "コッコロ", 1, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, 80003, 105901, 0, 184);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 6, "キャル", 2, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, 80003, 106001, 0, 185);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 6, "キャル", 2, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, 80003, 106001, 0, 186);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 6, "キャル", 2, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, 80003, 106001, 0, 187);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 6, "ペコリーヌ", 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 80003, 105801, 0, 188);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 6, "コッコロ", 1, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, 80003, 105901, 0, 189);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 6, "キャル", 2, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, 80003, 106001, 0, 190);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 7, "キャル", 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 80003, 106001, 0, 191);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 7, "キャル", 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 80003, 106001, 0, 192);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 7, "キャル", 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 80003, 106001, 0, 193);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 7, "キャル", 0, "あー\nあー\n…声、これで大丈夫かしら？", 0, 80003, 106001, 0, 194);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 7, "キャル", 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 80003, 106001, 0, 195);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 7, "キャル", 0, "オイッスー☆", 0, 80003, 106001, 0, 196);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 7, "キャル", 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 80003, 106001, 0, 197);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 7, "キャル", 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 80003, 106001, 0, 198);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 7, "キャル", 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 80003, 106001, 0, 199);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 8, "コッコロ", 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 80003, 105901, 0, 200);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 8, "コッコロ", 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 80003, 105901, 0, 201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 8, "コッコロ", 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 80003, 105901, 0, 202);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 8, "コッコロ", 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 80003, 105901, 0, 203);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 8, "コッコロ", 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 80003, 105901, 0, 204);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 8, "コッコロ", 0, "オイッスー☆", 0, 80003, 105901, 0, 205);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 8, "コッコロ", 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 80003, 105901, 0, 206);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 8, "コッコロ", 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 80003, 105901, 0, 207);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 8, "コッコロ", 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 80003, 105901, 0, 208);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 9, "ペコリーヌ", 0, "オイッスー☆", 0, 80003, 105801, 0, 209);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 9, "ペコリーヌ", 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 80003, 105801, 0, 210);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 9, "ペコリーヌ", 0, "あと６日で2.5周年ですか…", 0, 80003, 105801, 0, 211);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 9, "ペコリーヌ", 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 80003, 105801, 0, 212);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 9, "ペコリーヌ", 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 80003, 105801, 0, 213);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 9, "ペコリーヌ", 0, "オイッスー☆", 0, 80003, 105801, 0, 214);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 9, "ペコリーヌ", 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 80003, 105801, 0, 215);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 9, "ペコリーヌ", 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 80003, 105801, 0, 216);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 9, "ペコリーヌ", 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 80003, 105801, 0, 217);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 9, "ペコリーヌ", 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 80003, 105801, 0, 218);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 9, "ペコリーヌ", 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 80003, 105801, 0, 219);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 10, "ペコリーヌ", 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 80003, 105801, 0, 220);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 10, "コッコロ", 1, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, 80003, 105901, 0, 221);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 10, "ペコリーヌ", 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 80003, 105801, 0, 222);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 10, "キャル", 2, "…………", 0, 80003, 106001, 0, 223);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 10, "コッコロ", 1, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, 80003, 105901, 0, 224);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 10, "キャル", 2, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, 80003, 106001, 0, 225);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 10, "ペコリーヌ", 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 80003, 105801, 0, 226);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 10, "キャル", 2, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, 80003, 106001, 0, 227);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 10, "ペコリーヌ", 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 80003, 105801, 0, 228);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 10, "ペコリーヌ", 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 80003, 105801, 0, 229);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 10, "キャル", 2, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, 80003, 106001, 0, 230);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 10, "コッコロ", 1, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, 80003, 105901, 0, 231);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 10, "キャル", 2, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, 80003, 106001, 0, 232);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 10, "ペコリーヌ", 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 80003, 105801, 0, 233);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 11, "カリン", 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 80003, 190801, 0, 234);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 11, "カリン", 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 80003, 190801, 0, 235);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 11, "カリン", 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 80003, 190801, 0, 236);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 11, "カリン", 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 80003, 190801, 0, 237);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 11, "カリン", 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 80003, 190801, 0, 238);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 11, "カリン", 0, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 80003, 190801, 0, 239);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 11, "カリン", 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 80003, 190801, 0, 240);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 11, "カリン", 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 80003, 190801, 0, 241);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 11, "カリン", 0, "あれ？\nもしかして緊張で気を失って…？", 0, 80003, 190801, 0, 242);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 11, "カリン", 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 80003, 190801, 0, 243);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 11, "カリン", 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 80003, 190801, 0, 244);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 11, "カリン", 0, "それでは\nまた明日お会いしましょう♪", 0, 80003, 190801, 0, 245);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 12, "キャル", 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 80003, 106001, 0, 246);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 12, "ペコリーヌ", 2, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, 80003, 105801, 0, 247);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 12, "コッコロ", 1, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, 80003, 105901, 0, 248);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 45, 0, 12, "キャル", 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 80003, 106001, 0, 249);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 12, "ペコリーヌ", 2, "ひどいですよぉキャルちゃ～ん！", 0, 80003, 105801, 0, 250);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 12, "コッコロ", 1, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, 80003, 105901, 0, 251);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 12, "ペコリーヌ", 2, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, 80003, 105801, 0, 252);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 46, 0, 12, "キャル", 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 80003, 106001, 0, 253);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 12, "コッコロ", 1, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, 80003, 105901, 0, 254);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 12, "ペコリーヌ", 2, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, 80003, 105801, 0, 255);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 13, "ペコリーヌ", 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 80003, 105801, 0, 256);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 47, 0, 13, "キャル", 2, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, 80003, 106001, 0, 257);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 13, "ペコリーヌ", 0, "忘れてきちゃいました☆", 0, 80003, 105801, 0, 258);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 48, 0, 13, "キャル", 2, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, 80003, 106001, 0, 259);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 13, "コッコロ", 1, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, 80003, 105901, 0, 260);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 49, 0, 13, "キャル", 2, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, 80003, 106001, 0, 261);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 13, "ペコリーヌ", 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 80003, 105801, 0, 262);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 50, 0, 13, "キャル", 2, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, 80003, 106001, 0, 263);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 13, "コッコロ", 1, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, 80003, 105901, 0, 264);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 51, 0, 13, "キャル", 2, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, 80003, 106001, 0, 265);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 13, "コッコロ", 1, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, 80003, 105901, 0, 266);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 52, 0, 13, "キャル", 2, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, 80003, 106001, 0, 267);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 13, "ペコリーヌ", 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 80003, 105801, 0, 268);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 13, "コッコロ", 1, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, 80003, 105901, 0, 269);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 45, 0, 13, "ペコリーヌ", 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 80003, 105801, 0, 270);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 53, 0, 13, "キャル", 2, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, 80003, 106001, 0, 271);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 46, 0, 13, "ペコリーヌ", 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 80003, 105801, 0, 272);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 14, "カリン", 0, "こんにちは\n【ギルド管理協会】のカリンです", 0, 80003, 190801, 0, 273);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 14, "カリン", 0, "昨日の生放送は\nいかがだったでしょうか？", 0, 80003, 190801, 0, 274);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 14, "カリン", 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 80003, 190801, 0, 275);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 14, "カリン", 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 80003, 190801, 0, 276);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 14, "カリン", 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 80003, 190801, 0, 277);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 14, "カリン", 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 80003, 190801, 0, 278);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 14, "カリン", 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 80003, 190801, 0, 279);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 14, "カリン", 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 80003, 190801, 0, 280);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 14, "カリン", 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 80003, 190801, 0, 281);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 14, "カリン", 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 80003, 190801, 0, 282);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 47, 0, 15, "ペコリーヌ", 0, "準備はいいですかっ？\n…いっきますよー！", 0, 80003, 105801, 0, 283);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 54, 0, 15, "キャル", 2, "祝！", 0, 80003, 106001, 0, 284);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 15, "コッコロ", 1, "2.5周年！", 0, 80003, 105901, 0, 285);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 48, 0, 15, "ペコリーヌ", 0, "おめでとうございま～す☆", 0, 80003, 105801, 0, 286);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 55, 0, 15, "キャル", 2, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, 80003, 106001, 0, 287);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 15, "コッコロ", 1, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, 80003, 105901, 0, 288);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 49, 0, 15, "ペコリーヌ", 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 80003, 105801, 0, 289);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 56, 0, 15, "キャル", 2, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, 80003, 106001, 0, 290);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 15, "コッコロ", 1, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, 80003, 105901, 0, 291);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 57, 0, 15, "キャル", 2, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, 80003, 106001, 0, 292);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 50, 0, 15, "ペコリーヌ", 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 80003, 105801, 0, 293);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 58, 0, 15, "キャル", 2, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, 80003, 106001, 0, 294);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 51, 0, 15, "ペコリーヌ", 0, "記念日だから\n平気平気♪\nやばいですね☆", 0, 80003, 105801, 0, 295);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 59, 0, 15, "キャル", 2, "意味分かんないわよ！", 0, 80003, 106001, 0, 296);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 15, "コッコロ", 1, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, 80003, 105901, 0, 297);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 15, "コッコロ", 1, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, 80003, 105901, 0, 298);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 52, 0, 15, "ペコリーヌ", 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 80003, 105801, 0, 299);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 60, 0, 15, "キャル", 2, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, 80003, 106001, 0, 300);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 15, "コッコロ", 1, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, 80003, 105901, 0, 301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 53, 0, 15, "ペコリーヌ", 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 80003, 105801, 0, 302);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("105901,45,106001,61", 54, 0, 15, "ペコリーヌ・コッコロ・キャル", 0, "2.5周年\nありがとうございます！", 0, 80003, 105801, 1, 303);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60002, 190804, 0, 304);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 60002, 0, 0, 305);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60002, 0, 0, 306);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, 60002, 0, 0, 307);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, 60002, 0, 0, 308);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, 60002, 0, 0, 309);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 60002, 0, 0, 310);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 60002, 0, 0, 311);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 60002, 0, 0, 312);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 60002, 0, 0, 313);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 60002, 0, 0, 314);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, 60002, 0, 0, 315);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, 60002, 0, 0, 316);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60002, 0, 0, 317);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, 60002, 0, 0, 318);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 3, 60002, 0, 0, 319);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60002, 0, 0, 320);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 3, 60002, 0, 0, 321);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, 60002, 0, 0, 322);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 4, 60002, 0, 0, 323);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 4, 60002, 0, 0, 324);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 4, 60002, 0, 0, 325);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 4, 60002, 0, 0, 326);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 4, 60002, 0, 0, 327);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 4, 60002, 0, 0, 328);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 0, "カリン", 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 60002, 190804, 0, 329);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 7, "カリン", 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 60002, 190804, 0, 330);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "コッコロ", 4, "ささ、シェフィさまはこちらへ…", 0, 80005, 105901, 0, 331);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "シェフィ", 0, "コッコロさん、どこへ行くの…？\n…え？", 0, 80005, 106401, 0, 332);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "ペコリーヌ", 3, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, 80005, 105801, 0, 333);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "コッコロ", 4, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, 80005, 105901, 0, 334);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "シェフィ", 0, "ええと…\n二人とも何をしているの？", 0, 80005, 106401, 0, 335);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "キャル", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, 80005, 106001, 0, 336);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "シェフィ", 0, "あの日…？", 0, 80005, 106401, 0, 337);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "ペコリーヌ", 3, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, 80005, 105801, 0, 338);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "ペコリーヌ", 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, 80005, 105801, 0, 339);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 0, 1, "カリン", 2, "やばいですね☆", 0, 80005, 190801, 0, 340);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "キャル", 1, "って、なにしれっと\n参加してんのよカリン！", 0, 80005, 106001, 0, 341);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 2, 0, 1, "カリン", 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, 80005, 190801, 0, 342);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 1, "カリン", 2, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, 80005, 190801, 0, 343);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 1, "ペコリーヌ", 3, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, 80005, 105801, 0, 344);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 1, "シェフィ", 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 80005, 106401, 0, 345);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "ペコリーヌ", 3, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, 80005, 105801, 0, 346);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 2, "コッコロ", 1, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, 80005, 105901, 0, 347);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 2, "コッコロ", 1, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, 80005, 105901, 0, 348);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 2, "ペコリーヌ", 3, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, 80005, 105801, 0, 349);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "コッコロ", 1, "さすがでございます\nペコリーヌさま", 0, 80005, 105901, 0, 350);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 3, 0, 2, "キャル", 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 80005, 106001, 0, 351);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "シェフィ", 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 0, 80005, 106401, 0, 352);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 2, "ペコリーヌ", 3, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, 80005, 105801, 0, 353);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 2, "コッコロ", 1, "さ、次はキャルさまの\n番でございますよ", 0, 80005, 105901, 0, 354);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 2, "キャル", 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 80005, 106001, 0, 355);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 2, "シェフィ", 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, 80005, 106401, 0, 356);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 2, "キャル", 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 80005, 106001, 0, 357);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 2, "キャル", 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 80005, 106001, 0, 358);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 2, "コッコロ", 1, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, 80005, 105901, 0, 359);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 2, "キャル", 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 80005, 106001, 0, 360);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "コッコロ", 1, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, 80005, 105901, 0, 361);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "ペコリーヌ", 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, 80005, 105801, 0, 362);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "コッコロ", 1, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, 80005, 105901, 0, 363);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 3, "シェフィ", 2, "聖学祭…って、なにかしら？", 0, 80005, 106401, 0, 364);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 3, "コッコロ", 1, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, 80005, 105901, 0, 365);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "キャル", 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 80005, 106001, 0, 366);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "キャル", 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 80005, 106001, 0, 367);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "ペコリーヌ", 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, 80005, 105801, 0, 368);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 3, "キャル", 0, "いや、そのまんますぎでしょ…", 0, 80005, 106001, 0, 369);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 3, "シェフィ", 2, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, 80005, 106401, 0, 370);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 3, "ペコリーヌ", 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, 80005, 105801, 0, 371);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 3, "シェフィ", 2, "えっ？　ええ…\nぎゅーっ…？", 0, 80005, 106401, 0, 372);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 4, "キャル", 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 80005, 106001, 0, 373);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 4, "シェフィ", 2, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, 80005, 106401, 0, 374);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "キャル", 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 80005, 106001, 0, 375);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 4, "コッコロ", 1, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, 80005, 105901, 0, 376);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 4, "キャル", 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 80005, 106001, 0, 377);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 4, "ペコリーヌ", 3, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, 80005, 105801, 0, 378);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 4, "キャル", 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 80005, 106001, 0, 379);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 4, "キャル", 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 80005, 106001, 0, 380);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 4, "シェフィ", 2, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, 80005, 106401, 0, 381);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "ペコリーヌ", 3, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, 80005, 105801, 0, 382);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "コッコロ", 1, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, 80005, 105901, 0, 383);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 4, "キャル", 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 80005, 106001, 0, 384);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 12, 0, 4, "シェフィ", 2, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, 80005, 106401, 0, 385);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 5, "ペコリーヌ", 3, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, 80005, 105801, 0, 386);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 5, "ペコリーヌ", 3, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, 80005, 105801, 0, 387);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 5, "ペコリーヌ", 3, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, 80005, 105801, 0, 388);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 5, "キャル", 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 80005, 106001, 0, 389);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 5, "キャル", 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 80005, 106001, 0, 390);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 5, "シェフィ", 2, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, 80005, 106401, 0, 391);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 5, "コッコロ", 1, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, 80005, 105901, 0, 392);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 5, "ペコリーヌ", 3, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, 80005, 105801, 0, 393);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 5, "キャル", 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 80005, 106001, 0, 394);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 5, "ペコリーヌ", 3, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, 80005, 105801, 0, 395);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 5, "ペコリーヌ", 3, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, 80005, 105801, 0, 396);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 5, "ペコリーヌ", 3, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, 80005, 105801, 0, 397);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 4, 0, 6, "カリン", 2, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, 80005, 190801, 0, 398);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 5, 0, 6, "カリン", 2, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, 80005, 190801, 0, 399);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 6, "キャル", 1, "…えっ！？", 0, 80005, 106001, 0, 400);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 6, "ペコリーヌ", 3, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, 80005, 105801, 0, 401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 6, "シェフィ", 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 80005, 106401, 0, 402);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 6, "コッコロ", 4, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, 80005, 105901, 0, 403);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 6, "シェフィ", 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 80005, 106401, 0, 404);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 6, "キャル", 1, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, 80005, 106001, 0, 405);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 6, "ペコリーヌ", 3, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, 80005, 105801, 0, 406);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 6, "キャル", 1, "ぶっ殺すぞ！？", 0, 80005, 106001, 0, 407);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 6, 0, 6, "カリン", 2, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, 80005, 190801, 0, 408);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 7, "コッコロ", 1, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, 80005, 105901, 0, 409);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 7, "キャル", 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 80005, 106001, 0, 410);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 7, "シェフィ", 2, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, 80005, 106401, 0, 411);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 7, "ペコリーヌ", 3, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, 80005, 105801, 0, 412);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 7, "キャル", 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 80005, 106001, 0, 413);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 7, "シェフィ", 2, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, 80005, 106401, 0, 414);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 16, 0, 7, "コッコロ", 1, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, 80005, 105901, 0, 415);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 7, "シェフィ", 2, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, 80005, 106401, 0, 416);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 17, 0, 7, "コッコロ", 1, "もちろんでございます\n仲良くお勉強いたしましょう", 0, 80005, 105901, 0, 417);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 7, "キャル", 0, "しれっと教育ママが\n生まれてる…？", 0, 80005, 106001, 0, 418);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 7, "ペコリーヌ", 3, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, 80005, 105801, 0, 419);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 7, "キャル", 0, "え～～～～！？", 0, 80005, 106001, 0, 420);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 8, "キャル", 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 80005, 106001, 0, 421);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 8, "シェフィ", 2, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, 80005, 106401, 0, 422);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 18, 0, 8, "コッコロ", 1, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, 80005, 105901, 0, 423);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 8, "ペコリーヌ", 3, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, 80005, 105801, 0, 424);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 8, "シェフィ", 2, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, 80005, 106401, 0, 425);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 8, "キャル", 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 80005, 106001, 0, 426);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 19, 0, 8, "コッコロ", 1, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, 80005, 105901, 0, 427);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 8, "シェフィ", 2, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, 80005, 106401, 0, 428);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 8, "キャル", 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 80005, 106001, 0, 429);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 8, "キャル", 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 80005, 106001, 0, 430);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 8, "ペコリーヌ", 3, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, 80005, 105801, 0, 431);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 8, "キャル", 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 80005, 106001, 0, 432);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 9, "シェフィ", 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 80005, 106401, 0, 433);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 9, "シェフィ", 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 80005, 106401, 0, 434);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 9, "シェフィ", 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 80005, 106401, 0, 435);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 9, "シェフィ", 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 80005, 106401, 0, 436);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 9, "シェフィ", 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 80005, 106401, 0, 437);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 9, "シェフィ", 0, "それから、それから…！\nぅ、ぅぅっ…！", 0, 80005, 106401, 0, 438);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 9, "シェフィ", 0, "―びえぇぇ～んっ！！！", 0, 80005, 106401, 0, 439);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 20, 0, 9, "コッコロ", 1, "どうされましたか、シェフィさま", 0, 80005, 105901, 0, 440);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 9, "シェフィ", 0, "ううっ…ひっく…\nママッ…！", 0, 80005, 106401, 0, 441);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 21, 0, 9, "コッコロ", 1, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, 80005, 105901, 0, 442);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 22, 0, 9, "コッコロ", 1, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, 80005, 105901, 0, 443);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 9, "シェフィ", 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 80005, 106401, 0, 444);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 23, 0, 10, "コッコロ", 0, "主さま\n3.5周年まであと５日\nでございます", 0, 80005, 105901, 0, 445);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 24, 0, 10, "コッコロ", 0, "ですがその前に\n生放送がありますね", 0, 80005, 105901, 0, 446);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 25, 0, 10, "コッコロ", 0, "…生放送に向けた\n意気込みでございますか？", 0, 80005, 105901, 0, 447);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 10, "コッコロ", 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 80005, 105901, 0, 448);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 10, "コッコロ", 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 80005, 105901, 0, 449);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 10, "コッコロ", 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 80005, 105901, 0, 450);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 10, "コッコロ", 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 80005, 105901, 0, 451);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 10, "コッコロ", 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 80005, 105901, 0, 452);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 10, "コッコロ", 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 80005, 105901, 0, 453);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 26, 0, 11, "ペコリーヌ", 0, "3.5周年まであと４日！\nやばいですね☆", 0, 80005, 105801, 0, 454);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 11, "キャル", 1, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, 80005, 106001, 0, 455);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 27, 0, 11, "ペコリーヌ", 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 80005, 105801, 0, 456);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 28, 0, 11, "ペコリーヌ", 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 80005, 105801, 0, 457);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 29, 0, 11, "ペコリーヌ", 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 80005, 105801, 0, 458);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 11, "キャル", 1, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, 80005, 106001, 0, 459);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 30, 0, 11, "ペコリーヌ", 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 80005, 105801, 0, 460);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 11, "ペコリーヌ", 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 80005, 105801, 0, 461);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 11, "ペコリーヌ", 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 80005, 105801, 0, 462);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 11, "キャル", 1, "だからあたしはやるなんて一言も…", 0, 80005, 106001, 0, 463);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 11, "ペコリーヌ", 0, "オイッスー☆", 0, 80005, 105801, 0, 464);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 11, "キャル", 1, "聞きなさいっての！！", 0, 80005, 106001, 0, 465);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 31, 0, 12, "シェフィ", 2, "3.5周年まであと３日…\nそして生放送は、明日…", 0, 80005, 106401, 0, 466);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 12, "シェフィ", 2, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, 80005, 106401, 0, 467);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 12, "シェフィ", 2, "おいっす！\n…こうじゃなかったわね\nええと確か…", 0, 80005, 106401, 0, 468);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 12, "シェフィ", 2, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, 80005, 106401, 0, 469);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 12, "シェフィ", 2, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, 80005, 106401, 0, 470);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 34, 0, 12, "ペコリーヌ", 3, "やってますねシェフィちゃん！", 0, 80005, 105801, 0, 471);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 12, "キャル", 0, "なによ、考えることは\nみんな同じってこと？", 0, 80005, 106001, 0, 472);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 32, 0, 12, "コッコロ", 1, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, 80005, 105901, 0, 473);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 12, "シェフィ", 2, "みんな…もちろんよ！", 0, 80005, 106401, 0, 474);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 12, "ペコリーヌ", 3, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, 80005, 105801, 0, 475);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 7, 0, 13, "カリン", 2, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, 80005, 190801, 0, 476);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 8, 0, 13, "カリン", 2, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, 80005, 190801, 0, 477);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 13, "ペコリーヌ", 3, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, 80005, 105801, 0, 478);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 9, 0, 13, "カリン", 2, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, 80005, 190801, 0, 479);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 33, 0, 13, "コッコロ", 4, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, 80005, 105901, 0, 480);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 10, 0, 13, "カリン", 2, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, 80005, 190801, 0, 481);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 13, "キャル", 1, "大丈夫…大丈夫…\nあたしは大丈夫…", 0, 80005, 106001, 0, 482);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 11, 0, 13, "カリン", 2, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, 80005, 190801, 0, 483);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 13, "シェフィ", 0, "あうー？", 0, 80005, 106401, 0, 484);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("105901,34,106001,38,190801,12", 37, 0, 13, "みんな", 4, "あ…", 0, 80005, 105801, 1, 485);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 13, "キャル", 1, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, 80005, 106001, 0, 486);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 35, 0, 13, "コッコロ", 4, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, 80005, 105901, 0, 487);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 13, "ペコリーヌ", 3, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, 80005, 105801, 0, 488);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 13, 0, 13, "カリン", 2, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, 80005, 190801, 0, 489);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 14, "シェフィ", 2, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, 80005, 106401, 0, 490);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 14, "ペコリーヌ", 3, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, 80005, 105801, 0, 491);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 14, "キャル", 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 80005, 106001, 0, 492);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 36, 0, 14, "コッコロ", 1, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, 80005, 105901, 0, 493);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 14, "シェフィ", 2, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, 80005, 106401, 0, 494);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 14, "ペコリーヌ", 3, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, 80005, 105801, 0, 495);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 37, 0, 14, "コッコロ", 1, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, 80005, 105901, 0, 496);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 14, "キャル", 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 80005, 106001, 0, 497);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 14, "シェフィ", 2, "へ、へぇ…", 0, 80005, 106401, 0, 498);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 14, "ペコリーヌ", 3, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, 80005, 105801, 0, 499);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 14, "シェフィ", 2, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, 80005, 106401, 0, 500);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 14, "シェフィ", 2, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, 80005, 106401, 0, 501);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 15, "ペコリーヌ", 3, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, 80005, 105801, 0, 502);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 42, 0, 15, "キャル", 1, "祝！", 0, 80005, 106001, 0, 503);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 38, 0, 15, "コッコロ", 4, "3.5周年！", 0, 80005, 105901, 0, 504);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 15, "シェフィ", 0, "おめでとうございます！", 0, 80005, 106401, 0, 505);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 14, 0, 15, "カリン", 2, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, 80005, 190801, 0, 506);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 15, 0, 15, "カリン", 2, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, 80005, 190801, 0, 507);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 15, "ペコリーヌ", 3, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, 80005, 105801, 0, 508);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 15, "ペコリーヌ", 3, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, 80005, 105801, 0, 509);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 43, 0, 15, "キャル", 1, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, 80005, 106001, 0, 510);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 15, "キャル", 1, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, 80005, 106001, 0, 511);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 44, 0, 15, "シェフィ", 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 80005, 106401, 0, 512);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 45, 0, 15, "シェフィ", 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 80005, 106401, 0, 513);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 39, 0, 15, "コッコロ", 4, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, 80005, 105901, 0, 514);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 40, 0, 15, "コッコロ", 4, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, 80005, 105901, 0, 515);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 41, 0, 15, "コッコロ", 4, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, 80005, 105901, 0, 516);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 45, 0, 15, "ペコリーヌ", 3, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, 80005, 105801, 0, 517);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("105901,42,106001,45,106401,46,190801,16", 46, 0, 15, "みんな", 4, "これからも\nよろしくおねがいします！", 0, 80005, 105801, 1, 518);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 1, 1, 0, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 60003, 190804, 0, 519);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, 60003, 0, 0, 520);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, 60003, 0, 0, 521);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, 60003, 0, 0, 522);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, 60003, 0, 0, 523);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 1, 60003, 0, 0, 524);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 60003, 0, 0, 525);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 60003, 0, 0, 526);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 2, 60003, 0, 0, 527);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 2, 60003, 0, 0, 528);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 60003, 0, 0, 529);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 3, 60003, 0, 0, 530);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 3, 60003, 0, 0, 531);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 3, 60003, 0, 0, 532);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 3, 60003, 0, 0, 533);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 3, 60003, 0, 0, 534);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 3, 60003, 0, 0, 535);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 2, 0, "", 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 3, 60003, 0, 0, 536);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("", 0, 1, 0, "", 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 4, 60003, 0, 0, 537);
